      out.write("<script>\r\n");
      out.write("	\r\n");
      out.write("	jQuery(function(){\r\n");
      out.write("		\r\n");
      out.write("		//더보기 버튼 클릭\r\n");
      out.write("		jQuery(\"#btnMore\").on('click',function(e) {\r\n");
      out.write("			$(\".btnArea\").css(\"display\",\"none\");\r\n");
