      out.write("		});\r\n");
      out.write("		\r\n");
      out.write("	});\r\n");
      out.write("\r\n");
      out.write("	\r\n");
      out.write("	function fncListJson(page) {\r\n");
      out.write("		jQuery(\"#page\").val(page);\r\n");
      out.write("		var formData =  jQuery(\"#form\").serialize();\r\n");
      out.write("		jQuery.ajax({\r\n");
      out.write("			type : \"GET\",\r\n");
      out.write("			url : \"/event/list.json\",\r\n");
      out.write("			cache : false,\r\n");
      out.write("			dataType : \"json\",\r\n");
      out.write("			data : formData,\r\n");
      out.write("			global : false,\r\n");
      out.write("			beforeSend: function() {\r\n");
      out.write("				commonJs.showLoadingBar(); //로딩바 show\r\n");
      out.write("         	},\r\n");
      out.write("            complete: function() {\r\n");
      out.write("				commonJs.closeLoadingBar(); //로딩바 hide\r\n");
      out.write("            },\r\n");
      out.write("			success : function(data){\r\n");
      out.write("				var sysCode = jQuery(\"#sysCode\").val();\r\n");
      out.write("				var _list = data.list;\r\n");
      out.write("				var _totalCount = data.totalCount;\r\n");
      out.write("				var html = \"\";\r\n");
      out.write("				if(_list != null && _list.length > 0){\r\n");
      out.write("					\r\n");
      out.write("					for(var i=0; i<_list.length; i++) {\r\n");
      out.write("						var _sysCode = _list[i].sysCode;	// 시스템코드\r\n");
      out.write("						var _thumbSn = _list[i].thumbSn;	// 섬네일순번\r\n");
      out.write("						var _thumbDc = _list[i].thumbDc;	// 섬네일 설명\r\n");
      out.write("						var _eventSn = _list[i].eventSn;	// 이벤트 순번\r\n");
      out.write("						var _eventTitle = _list[i].eventTitle;	// 이벤트 명\r\n");
      out.write("						var _eventDc = _list[i].eventDc;		// 이벤트 설명\r\n");
